const Menu = () => {
    const handleChange = (event) => {
        console.log("event")
        console.log(event)
    };
    return (
        <div className="book-shelf-changer">
            <select>
                <option value="none" disabled>
                    Move to...
                </option>
                <option value="currentlyReading">
                    Currently Reading
                </option>
                <option value="wantToRead" onChange={(event) => {
                    handleChange(event)
                }}>Want to Read
                </option>
                <option value="read" onChange={(event) => {
                    handleChange(event)
                }}>Read
                </option>
                <option value="none" onChange={(event) => {
                    handleChange(event)
                }}>None
                </option>
            </select>
        </div>
    )
};

export default Menu;
